import React from 'react';
import InventoryCardList from './inventoryCardList/InventoryCardList'


function Products() {
    return ( 
    <>
        <section className="product-page page">

            <InventoryCardList/>

            //icons8 link
            <a className='icons8' target="_blank" href="https://icons8.com/icon/0OM4gSwS9wED/soda">Soda</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a>
        </section>
    </> 
    );
}

export default Products;
